import React from 'react';
import ReactDom from 'react-dom';
import './index.css'
import * as c from "./App" 


ReactDom.render(
<>
<h1>{c.Add(12,20)}</h1>
<h1>{c.Sub(12,20)}</h1>
<h1>{c.Mul(12,20)}</h1>
<h1>{c.Sub(12,20)}</h1>
</>,
document.getElementById('root')
);
